import '../css/education.css';
import React from 'react';




class Education extends React.Component {
    render() {
        return (
            <div class="education">
                <h1 className="educationTitle">EDUCATION</h1>

                {/* <div className="educationContents"> */}

                <div className="educationText">

                    <div className="univeristy">University of Toronto, St. George Campus</div>
                    <ul>
                        <li>3rd year</li>
                        <li>Major: Computer Engineering</li>
                        <li>Specialization: Software</li>
                        <li>Minor: Artificial Intelligence</li>
                        <li>Minor: Engineering Business</li>
                    </ul>

                </div>
                {/* </div> */}

            </div>
        );
    }
}

export default Education;
